#BalticPower to pierwsza na świecie morska farma wiatrowa wykorzystująca niskoemisyjną stal w elementach konstrukcji. Do jej produkcji używany jest surowiec z recyklingu i energia odnawialna. Zastosowanie tego materiału pozwoli na ograniczenie śladu węglowego w całym cyklu życia turbiny o ~10%.

📄Więcej: https://t.co/V3ZD1g6bVy

@Northlandpower @Vestas @ArcelorMittal
